const TopDiv=styled.div``
const Vector=styled.div``

const Text=styled.div`
position: absolute;
width: 665.08px;
height: 40px;
left: calc(50% - 665.08px/2 + 0.1px);
top: calc(50% - 40px/2 - 86px);
font-family: 'Inter';
font-style: normal;
font-weight: 700;
font-size: 32px;
line-height: 40px;
display: flex;
align-items: center;
text-align: center;
letter-spacing: -0.96px;
color: #061237;
`
const Company=styled.div`
display: flex;
flex-direction: row;
align-items: flex-start;
padding: 0px;
gap: 32px;
position: absolute;
width: 1120px;
height: 138px;
left: calc(50% - 1120px/2);
top: 74px;
`
const BottomImg=styled.div`
width: 256px;
height: 138px;
flex: none;
order: 0;
flex-grow: 0;`
const Intro = () => {
  return (
    <Container>
      <Top>
        <TopDiv></TopDiv>
        <Main>
            <Left>
                <Head></Head>
                <Disc></Disc>
                <Explore></Explore>
            </Left>
            <Right></Right>
        </Main>
        <BlueDiv></BlueDiv>
        <WhiteDiv></WhiteDiv>
        <Vector></Vector>
        <BottomDiv></BottomDiv>
      </Top>
      <Bottom>
        <Text>Trusted and loved by the worldâ€™s best teams</Text>
        <Company>
            <BottomImg><img src="" /></BottomImg>
            <BottomImg><img src="" /></BottomImg>
            <BottomImg><img src="" /></BottomImg>
            <BottomImg><img src="" /></BottomImg>
        </Company>
      </Bottom>
    </Container>
  )
}

export default Intro
